import React, { Component } from 'react'

export default class FoodCategory extends Component {
    render() {
        return (
            <div className="box">
            <article className="media">

              <div className="media-content">
                <div className="content">

                    <h1>{this.props.nombre}</h1>

                </div>
              </div>

            </article>
          </div>
        )
    }
}
